import React from "react";
import './Login.css'
import {Link} from 'react-router-dom';

function Login(){
    return(
        <div className="main-login">
        <div className="login-container">

        </div>
            Login Page
            <Link to="/Registro">Registro</Link>
        </div>
    )
}

export default Login;
